(13,1,"2020-02-02 22:36:35","2020-02-02 22:36:35","<!-- wp:paragraph -->\n<p><p style=\"text-align: center;\"><span class=\"color_15\">We are an independent life safety company dedicated to&nbsp;bringing you the best quality service possible for your fire&nbsp;alarm needs,&nbsp;including fire alarm system inspections,&nbsp;repairs, tenant finish and system replacement.</span>&nbsp;</p>\n<p class=\"font_8\" style=\"text-align: center;\">Our technicians are factory trained with over 50 years combined experience in the Fire Alarm and low voltage field. &nbsp;We look forward to helping you with your life safety and building security needs.</p>\n<p class=\"font_8\">​</p></p>\n<!-- /wp:paragraph -->","About","","publish","closed","closed","","about","","","2020-02-27 02:37:26","2020-02-27 02:37:26","",0,"http://fastfireproject.local/?page_id=13",0,"page","",0),
