(15,1,"2020-02-02 22:36:35","2020-02-02 22:36:35","<!-- wp:uagb/section {\"classMigrate\":true,\"block_id\":\"6c9bd56b-2964-4630-ac68-49bdbb4fed55\",\"topPadding\":0,\"contentWidth\":\"full_width\",\"innerWidth\":2000,\"backgroundType\":\"color\",\"backgroundColor\":\"#abb8c3\",\"backgroundOpacity\":30} -->\n<section class=\"wp-block-uagb-section uagb-section__wrap uagb-section__background-color uagb-block-6c9bd56b-2964-4630-ac68-49bdbb4fed55\"><div class=\"uagb-section__overlay\"></div><div class=\"uagb-section__inner-wrap\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"></div></div>\n<!-- /wp:group -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:uagb/advanced-heading {\"block_id\":\"da9365fb-5bd3-4542-9df2-a79ab6ccb19f\",\"classMigrate\":true} -->\n<div class=\"wp-block-uagb-advanced-heading uagb-block-da9365fb-5bd3-4542-9df2-a79ab6ccb19f\"><h2 class=\"uagb-heading-text\">Construction</h2><div class=\"uagb-separator-wrap\"><div class=\"uagb-separator\"></div></div><p class=\"uagb-desc-text\">FAST Fire provides turn-key systems to meet your building and life safety needs. &nbsp;We provide CAD Design, Installation, Service, and Testing for Fire Alarm and Building Security.</p></div>\n<!-- /wp:uagb/advanced-heading -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:uagb/advanced-heading {\"block_id\":\"dbc8703b-534c-4a3f-a3fb-c394b96997e1\",\"classMigrate\":true} -->\n<div class=\"wp-block-uagb-advanced-heading uagb-block-dbc8703b-534c-4a3f-a3fb-c394b96997e1\"><h2 class=\"uagb-heading-text\">Service</h2><div class=\"uagb-separator-wrap\"><div class=\"uagb-separator\"></div></div><p class=\"uagb-desc-text\">FAST Fire provides service to a number of Fire and Security Systems.<br>&nbsp;<br>Emergency service is available to our customers 24 hours a&nbsp;<br>day, 7 days a week.</p></div>\n<!-- /wp:uagb/advanced-heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:uagb/advanced-heading {\"block_id\":\"34f11ac4-9646-426f-bd4f-10d447a8270c\",\"classMigrate\":true} -->\n<div class=\"wp-block-uagb-advanced-heading uagb-block-34f11ac4-9646-426f-bd4f-10d447a8270c\"><h2 class=\"uagb-heading-text\">Inspect</h2><div class=\"uagb-separator-wrap\"><div class=\"uagb-separator\"></div></div><p class=\"uagb-desc-text\">FAST Fire is a Building Reports Dealer, the leading Building Safety compliance reporting company on the market. &nbsp;FAST Fire is able to quickly perform inspections and provide a digital copy of the report on site&nbsp;within minutes of completing the inspection.</p></div>\n<!-- /wp:uagb/advanced-heading --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></section>\n<!-- /wp:uagb/section -->\n\n<!-- wp:uagb/columns {\"block_id\":\"9154283f-6b2c-4298-a925-ec8fd0bfe6dc\",\"classMigrate\":true,\"columns\":3,\"vAlign\":\"middle\",\"contentWidth\":\"custom\",\"backgroundType\":\"color\",\"backgroundColor\":\"#066a94\"} -->\n<section class=\"wp-block-uagb-columns uagb-columns__wrap uagb-columns__background-color uagb-columns__stack-mobile uagb-columns__valign-middle uagb-columns__gap-10 alignundefined uagb-block-9154283f-6b2c-4298-a925-ec8fd0bfe6dc\"><div class=\"uagb-columns__overlay\"></div><div class=\"uagb-columns__inner-wrap uagb-columns__columns-3\"><!-- wp:uagb/column {\"block_id\":\"86186e05-4786-4597-9d03-f18a603eef71\",\"classMigrate\":true} -->\n<div class=\"wp-block-uagb-column uagb-column__wrap uagb-column__background-undefined uagb-block-86186e05-4786-4597-9d03-f18a603eef71\"><div class=\"uagb-column__overlay\"></div><div class=\"uagb-column__inner-wrap\"><!-- wp:paragraph -->\n<p>Test</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:uagb/column -->\n\n<!-- wp:uagb/column {\"block_id\":\"06bfc112-66bd-4924-be43-0e220c646fbe\",\"classMigrate\":true} -->\n<div class=\"wp-block-uagb-column uagb-column__wrap uagb-column__background-undefined uagb-block-06bfc112-66bd-4924-be43-0e220c646fbe\"><div class=\"uagb-column__overlay\"></div><div class=\"uagb-column__inner-wrap\"><!-- wp:paragraph -->\n<p>Advanced Column</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:uagb/column -->\n\n<!-- wp:uagb/column {\"block_id\":\"729951af-819a-43db-9abf-66732e61bf92\",\"classMigrate\":true} -->\n<div class=\"wp-block-uagb-column uagb-column__wrap uagb-column__background-undefined uagb-block-729951af-819a-43db-9abf-66732e61bf92\"><div class=\"uagb-column__overlay\"></div><div class=\"uagb-column__inner-wrap\"><!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:uagb/advanced-heading {\"block_id\":\"5bf956f8-d08c-4da7-bb3f-1dc8cade315e\",\"classMigrate\":true} -->\n<div class=\"wp-block-uagb-advanced-heading uagb-block-5bf956f8-d08c-4da7-bb3f-1dc8cade315e\"><h2 class=\"uagb-heading-text\"></h2><div class=\"uagb-separator-wrap\"><div class=\"uagb-separator\"></div></div><p class=\"uagb-desc-text\"></p></div>\n<!-- /wp:uagb/advanced-heading -->\n\n<!-- wp:paragraph -->\n<p>FAST Fire is a Building Reports Dealer, the leading Building Safety compliance reporting company on the market.  FAST Fire is able to quickly perform inspections and provide a digital copy of the report on site within minutes of completing the inspection.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:uagb/column --></div></section>\n<!-- /wp:uagb/columns -->","Services","","publish","closed","closed","","services","","","2020-02-27 06:12:07","2020-02-27 06:12:07","",0,"http://fastfireproject.local/?page_id=15",0,"page","",0),
(16,1,"2020-02-02 22:36:35","2020-02-02 22:36:35","<!-- wp:paragraph -->\n<p>This is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.</p>\n<!-- /wp:paragraph -->","A homepage section","","publish","closed","closed","","a-homepage-section","","","2020-02-02 22:36:35","2020-02-02 22:36:35","",0,"http://fastfireproject.local/?page_id=16",0,"page","",0),
